import React from "react";
import { contained, Row, Button, Container } from "react-bootstrap";
export const Dashboard = () => {
  return (
    <Container>
      <Row>
        <Col>
          <Button variant="info" style={{ "font-size": "2rem" }}>
            Ajouter un Ticket
          </Button>
        </Col>
      </Row>
    </Container>
  );
};
